<template>
    <v-navigation-drawer
        permanent
    >
        <v-list
            v-model:opened="openedGroups"
            v-model:selected="selected"
            class="py-0"
            color="primary"
            selectable
            select-strategy="single-leaf"
            open-strategy="multiple"
            active-strategy="single-leaf"
            mandatory
        >
            <v-list-group v-for="group in groups" :key="group.name" :value="group.name">
                <template #activator="{ props }">
                    <v-list-item
                        base-color="grey-darken-3"
                        color="none"
                        density="compact"
                        variant="tonal"
                    >
                        <template #title>
                            <div v-bind="props">
                                {{ group.name }}
                            </div>
                        </template>

                        <template #prepend="{ isOpen }">
                            <v-icon v-if="isOpen" v-bind="props">mdi-chevron-down</v-icon>
                            <v-icon v-else v-bind="props">mdi-chevron-right</v-icon>
                        </template>

                        <template #append>
                            <v-tooltip location="bottom">
                                <template #activator="{ props: tProps }">
                                    <v-btn v-bind="tProps" variant="plain" density="compact" icon="mdi-file-document-plus-outline" @click="group.open = true" />
                                </template>
                                <span>Create samples</span>
                            </v-tooltip>
                        </template>
                    </v-list-item>
                </template>

                <v-list-item
                    v-if="group.analyses.length === 0"
                    class="text-primary"
                    title="Add new sample"
                    color="primary"
                    density="compact"
                    prepend-icon="mdi-file-document-plus-outline"
                    @click="group.open = true"
                />

                <v-list-item
                    v-for="analysis in group.analyses"
                    v-else
                    :key="analysis.id"
                    :value="analysis"
                    :title="analysis.name"
                    color="primary"
                    density="compact"
                    prepend-icon="mdi-file-document-outline"
                >
                    <template #append>
                        <v-tooltip v-if="analysis.status === AnalysisStatus.Finished" location="bottom">
                            <template #activator="{ props: tProps }">
                                <v-btn
                                    v-bind="tProps"
                                    class="me-1"
                                    variant="plain"
                                    density="compact"
                                    color="error"
                                    icon="mdi-delete-outline"
                                    @click="console.log"
                                />
                            </template>
                            <span>Remove <b>{{ analysis.name }}</b></span>
                        </v-tooltip>

                        <v-icon
                            v-if="analysis.status === AnalysisStatus.Pending"
                            icon="mdi-clock-outline"
                        />
                        <v-progress-circular
                            v-else-if="analysis.status === AnalysisStatus.Running"
                            color="primary"
                            size="20"
                            width="3"
                            indeterminate
                        />
                        <v-icon
                            v-else
                            icon="mdi-information-outline"
                        />
                    </template>
                </v-list-item>

                <create-sample
                    v-model="group.open"
                    @confirm="s => addSamples(group, s)"
                />
            </v-list-group>
        </v-list>

        <template #append>
            <div class="d-flex justify-center pa-3">
                <v-btn
                    color="primary"
                    prepend-icon="mdi-plus"
                    text="Create group"
                    @click="createGroup('New group')"
                />
            </div>
        </template>
    </v-navigation-drawer>

    <v-container>
        <v-card>
            <v-card-title class="pa-4 bg-primary text-white">
                Metaproteomics analysis
            </v-card-title>

            <v-layout>
                <v-main min-height="400">
                    <analysis-summary-progress v-if="selectedAnalysis && !selectedAnalysisFinished" />
                    <analysis-summary
                        v-else-if="selectedAnalysis && selectedAnalysisFinished"
                        :analysis="selectedAnalysis"
                        @update="updateAnalysis"
                    />
                </v-main>
            </v-layout>
        </v-card>
    </v-container>
</template>

<script lang="ts">
export interface AnalysisGroup {
    name: string;
    analysis: Analysis[];
    open: boolean;
}

export interface Analysis {
    id: number;
    sample: Sample;
    config: AnalysisConfig;
    result: AnalysisResult;
}

export interface Sample {
    name: string;
    rawPeptides: string;
}

export interface AnalysisConfig {
    equate: boolean;
    filter: boolean;
    missed: boolean;
    database: string;
}

export interface AnalysisResult {
    status: AnalysisStatus;
    config: AnalysisConfig;
}

export enum AnalysisStatus {
    Pending,
    Running,
    Finished
}
</script>

